Black Sabbath are cited, along with Led Zeppelin and Deep Purple, as pioneers of Heavy Metal The band helped define the genre with releases such as quadruple-platinum Paranoid, released in 1970.They were ranked by MTV as the &quot;Greatest Metal Band&quot; of all time and placed second in VH1's &quot;100 Greatest Artists of Hard Rock&quot; list, behind Led Zeppelin Rolling Stone has posited the band as 'the heavy-metal kings of the '70s'. They have sold over 15 million records in the United States alone and more than 100 million records worldwide. Black Sabbath were inducted into the Rock And Roll Hall of Fame in 2006, and were included among Rolling Stone's list of the 100 Greatest Artists of All Time.

This Black Sabbath Torrent contains all studio albums by Black Sabbath's original lineup:

Vocals:      Ozzy Osbourne
Lead Guitar: Tony Iommi
Bass Guitar: Geezer Butler
Drummer:     Bill Ward

The albums are:
Black Sabbath (1970)
Paranoid (1970)
Master of Reality (1971)
Black Sabbath Vol. 4 (1972)
